@EU_Commission funded the suppression of Romany communities in Italy;
funded the repression of migrants in Libya;
turned Bosnia into a dustbin for migrants on the Balkan route;
paid Erdogan 6 billion euros to stop them reaching Europe at all.

@EU_Commission Great achievements but...
the vote of more than 2 million Catalan citizens in the last European elections is still neglected.

🇪🇺 Respect Catalan votes! ✉️
@ourvoteseu
